        <script id="shader-vertex" type="x-shader/x-vertex">
            //position of a vertex.
            attribute vec4 aVertexPosition; 
            //vertex normal.
            attribute vec3 aNormal; 

            //mvp matrix
            uniform mat4 uObjMVP; 

            uniform mat3 uNormalMV; 

            //shadow mvp matrix
            uniform mat4 uShadowMVP;

            //interplate normals
            varying vec3 vNormal;

            //for shadow calculation
            varying vec4 vShadowPositionFromLight;
			varying vec3 vSpecularLight;

			vec3 eyeCd = vec3(-45.086, -10.548, 131.721);
			//暖光才有反射光，冷光只是单纯用于照亮太暗的地方
			vec3 warmLightCd = vec3(83.064, -173.467, 1.99);
			vec3 baseColor = vec3(0.8, 0.8, 0.8);
			float shininess = 8.0;
			
			vec3 calculateSepcularLight(){
				vec3 vertexToLight = normalize(warmLightCd - aVertexPosition.xyz);
				vec3 vertexToEye = normalize(eyeCd - aVertexPosition.xyz);
				vec3 reflectionVector = normalize(reflect(-vertexToLight, normalize(aNormal)));
				float rdotv = max(dot(reflectionVector, vertexToEye), 0.0);
				float specularLightWeight = pow(rdotv, shininess);
				//base color * light color * weight;
				return vec3(baseColor * vec3(0.831, 0.976, 0.243) * specularLightWeight);
			}
			
            void main() {       
                gl_Position = uObjMVP * aVertexPosition;

				vSpecularLight = calculateSepcularLight();
                //convert normal direction from object space to view space
                vNormal = uNormalMV * aNormal;

                vShadowPositionFromLight = uShadowMVP * aVertexPosition;
            }
        </script>

        <script id="shader-fragment" type="x-shader/x-fragment">
            precision mediump float;

            uniform sampler2D uShadowMap;

			varying vec3 vSpecularLight;
            varying vec3 vNormal;
            varying vec4 vShadowPositionFromLight;

            struct baseColor {
                vec3 ambient;
                vec3 diffuse;
            };

            struct directLight {
                vec3 direction;
                vec3 color;
            };

            baseColor mysObjBaseColor = baseColor(
                vec3(0.8, 0.8, 0.8),
                vec3(0.8, 0.8, 0.8)
            );

            directLight warmLight = directLight(
                normalize(vec3(-83.064, -1.99, -173.467)),
                vec3(0.831, 0.976, 0.243)
            );

            directLight coldLight = directLight(
                normalize(vec3(37.889, 47.864, -207.187)),
                vec3(0.196, 0.361, 0.608)
            );

            vec3 ambientLightColor = vec3(0.3, 0.3, 0.3);

            float unpackDepth(const in vec4 rgbaDepth) {
                const vec4 bitShift = vec4(1.0, 1.0/256.0, 1.0/(256.0*256.0), 1.0/(256.0*256.0*256.0));
                float depth = dot(rgbaDepth, bitShift);
                return depth;
            }

            float calVisibility() {
                vec3 shadowCoord = (vShadowPositionFromLight.xyz/vShadowPositionFromLight.w)/2.0 + 0.5;
                float recordedDepth = unpackDepth(texture2D(uShadowMap, shadowCoord.xy));
                return (shadowCoord.z > recordedDepth + 0.05) ? 0.4 : 1.0;                    
            }

            vec3 calAmbientLight(){
                return ambientLightColor * mysObjBaseColor.ambient;
            }

            vec3 calDiffuseLight(const in directLight light){
                vec3 inverseLightDir = light.direction * -1.0;
                float dot = max(dot(inverseLightDir, normalize(vNormal)), 0.0);
                return light.color * mysObjBaseColor.diffuse * dot;
            }
			
            void main() {
                vec3 ambientLight = calAmbientLight();
                vec3 coldDiffuseLight = calDiffuseLight(coldLight);
				//the following two lights are subject to shadow
				float visibility = calVisibility();
				vec3 warmDiffuseLight = calDiffuseLight(warmLight) * visibility;
				vec3 specularLight = vSpecularLight * visibility;
                gl_FragColor = vec4(coldDiffuseLight + warmDiffuseLight + specularLight + ambientLight, 1.0);
            }
        </script>

        <script id="shadow-shader-vertex" type="x-shader/x-vertex">
            attribute vec4 aVertexPosition;
            uniform mat4 uObjMVP;

            void main() {
                gl_Position = uObjMVP * aVertexPosition;
            }
        </script>

        <script id="shadow-shader-fragment" type="x-shader/x-vertex">
            precision mediump float;

            void main() {
                // pack gl_FragCoord.z
                const vec4 bitShift = vec4(1.0, 256.0, 256.0 * 256.0, 256.0 * 256.0 * 256.0);
                const vec4 bitMask = vec4(1.0/256.0, 1.0/256.0, 1.0/256.0, 0.0);
                vec4 rgbaDepth = fract(gl_FragCoord.z * bitShift);
                rgbaDepth -= rgbaDepth.gbaa * bitMask;
                
                // gl_FragColor = rgbaDepth;
                gl_FragColor = vec4(gl_FragCoord.z, 0.0, 0.0, 1.0);
            }
        </script>
        <script id="wall-shader-vertex" type="x-shader/x-vertex">
            attribute vec4 aVertexPosition;
            uniform mat4 uObjMVP;
            uniform mat4 uShadowMVP;

            varying vec4 vShadowPositionFromLight;

            void main() {
                gl_Position = uObjMVP * aVertexPosition;
                vShadowPositionFromLight = uShadowMVP * aVertexPosition;
            }
        </script>
        <script id="wall-shader-fragment" type="x－shader/x-vertex">
            precision mediump float;

            uniform sampler2D uShadowMap;
            varying vec4 vShadowPositionFromLight;

            float unpackDepth(const in vec4 rgbaDepth) {
                const vec4 bitShift = vec4(1.0, 1.0/256.0, 1.0/(256.0*256.0), 1.0/(256.0*256.0*256.0));
                float depth = dot(rgbaDepth, bitShift);
                return depth;
            }

            float calVisibility() {
                vec3 shadowCoord = (vShadowPositionFromLight.xyz/vShadowPositionFromLight.w)/2.0 + 0.5;
                float recordedDepth = unpackDepth(texture2D(uShadowMap, shadowCoord.xy));
                return (shadowCoord.z > recordedDepth + 0.05) ? 0.3 : 1.0;
            }

            void main() {
                float visibility = calVisibility();
                gl_FragColor = vec4(0.0, 0.0, 0.0, 1.0 - visibility);
            }
        </script>
		<script id="background-shader-vertex" type="x-shader/x-vertex">
            attribute vec4 aVertexPosition;

			attribute vec2 aTexCd;

            void main() {
                gl_Position = aVertexPosition;
				vTexCd = aTexCd;
            }
        </script>
        <script id="background-shader-fragment" type="x－shader/x-vertex">
            precision mediump float;

            uniform sampler2D uBackgroundTexture;

			varying vec2 vTexCd;
            void main() {
                gl_FragColor = texture2D(uBackgroundTexture, vTexCd);
            }
